// foo_json is a String
// Foo implements Serialize and Deserialize
let foo_json = serde_json::to_string(&foo_a)?;
let foo_b: Foo = serde_json::from_str(&foo_json)?; for this: // foo_a is a Foo
// JsonString implements From<Foo>
// Foo implements TryFrom<JsonString>
let foo_json = JsonString::from(foo_a);
let foo_b = Foo::try_from(hopefully_foo_json)?; Which looks very similar but protects us from this bug: let foo_json = serde_json::to_string(&foo_a)?;
let foo_json = serde_json::to_string(&foo_json)?; // <-- double serialized :/
let foo_b: Foo = serde_json::from_str(&foo_json)?; // <-- will fail :( Because nesting JsonString::from() calls is a compiler error: let foo_json = JsonString::from(JsonString::from(foo_a)); // <-- compiler saves us :) and this bug: let foo_a: Foo = serde_json::from_str(&string_but_not_json)?; // <-- runtime error :( Because calling Foo::try_from(String) is (probably) a compiler error: let foo_a = Foo::try_from(string_but_not_json)?; // <-- compiler saves us again :) and this bug: type Foo = Result<String, String>;
let foo_json_a = json!({"Err": some_error.to_string()}); // <-- good key `Err`
// somewhere else... maybe a different crate or old crate version...
let foo_json_b = json!({"error": some_error.to_string()}); // <-- bad key `error` :/ let foo: Foo = serde_json::from(&foo_json_a)?; // <-- works, key matches variant name
let foo: Foo = serde_json::from(&foo_json_b)?; // <-- runtime error! :( Because the structure of the JSON data is defined centrally at compile time: // Result<Into<JsonString>, Into<JsonString>> is implemented for you by HC core
