// only one way to do things, automatically consistent across all crates
// doing anything different is a compiler issue
let foo_json_b = JsonString::from(Err(some_error.to_string())); Which is great for the majority of data that needs serializing. There are some important edge cases that we need to cover with additional techniques/tooling. String handling JsonString::from_json(&str) requires the &str passed to it is already a serialized JSON value. We may add the option to validate this for debug builds at runtime in the future. Previously JsonString implemented the From<String> trait but this was removed. Strings are a special case as they may either contain serialized json or be used as a JSON string primitive. JsonString::from_json makes it explicit that you mean the former. We can use serde_json::to_string and json! to create JSON data that we can then wrap in JsonString . // same end result for both of these...
