As discussed in the intro to HDK article, by setting the HDK as a dependency in the Cargo.toml file, and then referencing it in src/lib.rs , Zome code in Rust gains access to a host of features. The first line in the following code snippet (from a src/lib.rs ) is important: #[macro_use] . This imports access to custom Rust macros defined by the HDK. What are Rust macros? Generally speaking, they are code that will actually generate other code, when compiled. They are shortcuts. Anywhere in Rust that you see an expression followed immediately (no space) by an exclamation mark (!) that is the use of a macro. In the case of Zome development, it was discovered that much code could be saved from being written, by encapsulating it in a macro. That is how define_zome! came about. It is a Rust macro imported from the HDK which must be used for every Zome (unless you read the source code for it yourself and write something that behaves the same way!) The following is technically the most minimalistic Zome that could be implemented. It does nothing, but still conforms to the expectations Holochain has for a Zome. #[macro_use]
extern crate hdk; define_zome! { entries: [] init: || { Ok(()) } validate_agent: |validation_data : EntryValidationData::<AgentId>| { Ok(()) } functions: []
} entries represents the validating entry type definitions. Note that it is an array, because there can be many. What validating entry types are will be explained next . init represents the previously mentioned init callback that Holochain expects from every Zome. Skip here for details. functions is where the functions are defined. Skip here for details. These are the three required properties of define_zome! .

