Recall that in define_zome! , there was an array called entries . The most minimalistic Zome could look like this: #[macro_use]
extern crate hdk; define_zome! { entries: [] init: || { Ok(()) } validate_agent: |validation_data : EntryValidationData::<AgentId>| { Ok(()) } functions: [] traits: {}
} entries is where we will populate the Zome with entry type definitions. It expects an array of ValidatingEntryType . So how can one be created? Easy: the entry! macro. It can be used to encapsulate everything needed to define an entry type. All of the following must be defined: name entry!( name: "post", ...
) This should be a machine-readable name for the entry type. Spaces should not be used. What will the entry type be that will be given when new entries are being created? description entry!( ... description: "A blog post entry which has an author", ...
) Historically this was a human-readable explanation of the meaning or role of this entry type. Now the description field can hold a stringified JSON object to hold various properties of this entry type (Possibly including a description but also UI display hints, indexing fields, example data etc. It is totally up to you). These properties can be accessed via hdk::entry_type_properties . sharing use hdk::holochain_core_types::dna::entry_types::Sharing; entry!( ... sharing: Sharing::Public, ...
) As mentioned above, sharing refers to whether entries of this type are private to their author, or whether they will be gossiped to other peers to hold copies of. The value must be referenced from an enum in the HDK . Holochain currently supports the first two values in the enum: Public, and Private. native_type extern crate serde;
extern crate serde_json;
#[macro_use]
extern crate serde_derive;
#[macro_use]
extern crate holochain_persistence_derive; #[derive(Serialize, Deserialize, Debug, DefaultJson,Clone)]
struct Post { content: String, date_created: String,
} entry!( ... native_type: Post, ...
) Clearly, native_type is where things start to get interesting. It requires the introduction of quite a number of dependencies, first of all. Why is that? It is important to remember that the Rust code of a Zome is compiled into WASM before it can be executed by Holochain. This introduces a certain constraint. How is data passed between Holochain, and the WASM Zome code? Answer: it is stored in the WASM memory as stringified JSON data, and accessed by the WASM code and by Holochain, running the WASM interpreter. JSON was chosen as the interchange format because it is so universal, and almost all languages have serializers and parsers. Rust's is called serde . The three serde related dependencies all relate to the need to serialize to and from JSON within Zomes. Additionally, the HDK offers built-in conversion functions from JSON strings to Entry structs. This comes from the DefaultJson derive . Every struct used as a native_type reference should include all 4 derives, as in the example: #[derive(Serialize, Deserialize, Debug, DefaultJson)] Serialize and Deserialize come from serde_derive , and DefaultJson comes from holochain_persistence_derive . Then there is the struct itself. This is the real type definition, because it defines the schema. It is simply a list of property names, the 'keys', and the types of values expected, which should be set to one of the primitive types of the language. This will tell serde how to parse JSON string inputs into the type. Note that conversion from JSON strings into the struct type can easily fail, in particular if the proper keys are not present on the input. validation_package use hdk::ValidationPackageDefinition; entry!( ... validation_package: || { ValidationPackageDefinition::Entry }, ...
) At the moment, what validation_package is will not be covered in great detail. In short, for a peer to perform validation of an entry from another peer, varying degrees of metadata from the original author of the entry might be needed. validation_package refers to the carrier for that extra metadata. Looking at the above code, there is a required import from the HDK needed for use in validation_package , and that's the enum ValidationPackageDefinition . The value of validation_package is a function that takes no arguments. It will be called as a callback by Holochain. The result should be a value from the ValidationPackageDefinition enum, whose values can be seen here . In the example, and as the most basic option, simply use Entry , which means no extra metadata beyond the entry itself is needed. Further reading is here . validation use hdk::EntryValidationData; entry!( ... validation: |_validation_data: ValidationData<Post>| { Ok(()) }
) validation is the last required property of entry! . Because it is such an important aspect, it has its' own in depth article . It is a callback that Holochain will call during different moments in the lifecycle of an entry, in order to confirm which action to take with the entry, depending on its' validity. It will be called with two arguments, the first representing the struct of the entry itself, and the second a struct holding extra metadata that can be used for validation, including, if it was requested, the validation_package . The callback should return a Rust Result type. This is seen in Ok(()) . The example above is the simplest possible validation function, since it doesn't perform any real logic. While this is ok in theory, great caution should be taken with the validation rules, and further reading is recommended. validation for a ValidatingEntryType should either return Ok(()) or an Err containing the string explaining why validation failed. The validity of an entry is therefore defined by the author of a Zome. First of all, data which doesn't conform to the schema defined by the native_type will fail, but validation allows for further rules to be defined. Note that not only the entry author will call this function to validate the entry during its' creation, but other peers will call this function to validate the entry when it is requested via the network that they hold a copy of it. This is at the heart of how Holochain functions as peer-to-peer data integrity layer. Further reading can be found here .

