Taken all together, use of the entry! macro may look something like the following: ...
entry!( name: "post", description: "A blog post entry which has an author", sharing: Sharing::Public, validation_package: || { ValidationPackageDefinition::Entry }, validation: |validation_data: EntryValidationData<Post>| { Ok(()) }
) This can be embedded directly inside of the entries array of the define_zome! , like so: ...
define_zome! { entries: [ entry!( name: "post", description: "A blog post entry which has an author", sharing: Sharing::Public, validation_package: || { ValidationPackageDefinition::Entry }, validation: | _validation_data: EntryValidationData<Post>| { Ok(()) } ) ] init: || { Ok(()) } validate_agent: |validation_data : EntryValidationData::<AgentId>| { Ok(()) } functions: [] capabilitites: {}
} If there is only entry type, this can be fine, but if there are multiple, this can hurt readability of the source code. You can wrap the entry type definition in a function, and call it in define_zome! , like so: ...
fn post_definition() -> ValidatingEntryType { entry!( name: "post", description: "A blog post entry which has an author", sharing: Sharing::Public, validation_package: || { hdk::ValidationPackageDefinition::Entry }, validation: |_validation_data: Validation<Post>| { Ok(()) } )
} define_zome! { entries: [ post_definition() ] init: || { Ok(()) } validate_agent: |validation_data : EntryValidationData::<AgentId>| { Ok(()) } functions: [] capabilitites: {}
} Use of this technique can help you write clean, modular code. If you want to look closely at a complete example of the use of `entry!` in a Zome, check out the [API reference](https://developer.holochain.org/api/0.0.26-alpha1/hdk/macro.entry.html), or the ["app-spec" example app](https://github.com/holochain/holochain-rust/blob/release-0.0.26-alpha1/app_spec/zomes/blog/code/src/post.rs). Summary This is still a pretty minimal Zome, since it doesn't have any functions yet, and the most basic init behaviour, so read on to learn about how to work with those aspects of define_zome! .

