How is init used within the Rust HDK? Previously , the general structure of define_zome! has been covered. It includes a Rust function closure called init , which is passed zero arguments. This is the hook that Holochain is expecting. It expects a Rust Result as a return value, which is either Ok(()) or an Err , with the string explaining the error. In the following two examples, nothing interesting will happen in the init functions, they are simply to illustrate how to return success, and how to return failure. More complex capabilities will be possible during init in the future, yet for now, using the first simple example that succeeds is recommended. If init should succeed: define_zome! { entries: [] init: || { Ok(()) } validate_agent: |validation_data : EntryValidationData::<AgentId>| { Ok(()) } functions: [] traits: {}
} If init should fail: define_zome! { entries: [] init: || { Err("the error string".to_string()) } validate_agent: |validation_data : EntryValidationData::<AgentId>| { Ok(()) } functions: [] traits: {}
}

