In order to add a Zome function, there are two primary steps that are involved. declare your function in define_zome! write the Rust code for the handler of that function, calling any HDK functions you need Step 1 The functions section looks a bit like an array of key-value pairs: ... define_zome! { ... functions: [ send_message: { inputs: |to_agent: Address, message: String|, outputs: |response: ZomeApiResult<String>|, handler: handle_send_message } ]
} In this example, send_message is the given name of this function, by which it will be referenced and called elsewhere. There are three properties necessary to provide send_message , and any function declaration: inputs , outputs , and handler . inputs expects a list or argument names, and types, for the send_message function to be called with. outputs expects a single declaration of a return type. The name (which in the example is response ) is arbitrary, call it anything. handler expects the name of a function which will handle this function call, and which matches the function signature of inputs and outputs . In this case, handle_send_message , which has yet to be defined. Step 2 Here is an example of a simplistic function, for illustration purposes. It centers on the use of a function call to an HDK function. fn handle_send_message(to_agent: Address, message: String) -> ZomeApiResult<String> { hdk::send(to_agent, message, 60000.into())
} Notice right away how the arguments match perfectly with the inputs: |...| section of the function declaration. Any differences will cause issues. This is also true of the return type of the output. Note the pairing of ZomeApiResult<String> as the return type. The name of the function, handle_send_message is the same as the name given as the handler in the define_zome! function declaration. Within the function, handle_send_message makes use of a Holochain/HDK function that sends messages directly node-to-node . The available functions, their purpose, and how to use them is fully documented elsewhere, in the API reference and the List of API Functions . In the example, handle_send_message simply forwards the result of calling hdk::send as its' own result. Here are the above two steps combined: ... fn handle_send_message(to_agent: Address, message: String) -> ZomeApiResult<String> { hdk::send(to_agent, message, 60000.into())
} define_zome! { ... functions: [ send_message: { inputs: |to_agent: Address, message: String|, outputs: |response: ZomeApiResult<String>|, handler: handle_send_message } ]
} To see plenty of examples of adding functions, check out a file used for testing the many capacities of the HDK .
